import React from 'react';
import '../App.css';
import { Button } from './Button';
import './HeroSection.css';

function HeroSection() {

  const signup = () => {
    window.open('https://docs.google.com/spreadsheets/d/1YuzBM5KBdwxv-IPzfpTOIvmTidpL37fYNjkDT_su4u0/edit#gid=0', '_blank');
  };
  const slack = () => {
    window.open('https://app.slack.com/client/T02KCD5F37T/C02KCD5GHFT', '_blank');
  };

  return (
    <div className='hero-container'>
      <video src='/videos/frn2024.mov' autoPlay loop muted />
      <h1>FOOD RECOVERY NETWORK AT BROWN</h1>
      <p>Fight waste. Feed people.</p>
      <div className='hero-btns'>
      <Button style={{ backgroundColor: 'blue', color: 'white' }} onClick={signup}>
  JOIN OUR TEAM
</Button>
        <Button
         className='btns'
         buttonStyle='btn--outline'
         buttonSize='btn--large'
         onClick={slack} // Add onClick event handler
       >
          JOIN OUR SLACK
        </Button>
      </div>
    </div>
  );
}

export default HeroSection;
